export default class UserModel {

    private _uid: number ;
    private _username: string;
    private _email: string;
    private _avtImgUrl: string;

    constructor() {
    }

    get uid(): number {
        return this._uid;
    }

    get username(): string {
        return this._username;
    }

    get email(): string {
        return this._email;
    }

    get avtImgUrl(): string {
        return this._avtImgUrl;
    }

    set uid(uid: number) {
        this._uid = uid;
    }

    set username(username: string) {
        this._username = username;
    }

    set email(email: string) {
        this._email = email;
    }

    set avtImgUrl(avtImgUrl: string) {
         this._avtImgUrl = avtImgUrl;
    }
}
